import keyboard from "../assets/keyboard.jpg";

function AboutMe() {
  return (
    <div className=" flex flex-row bg-lightTone font-racing p-8 gap-8 max-w-screen-xl max-auto">
      <div className="max-w-2xl">
        <img className="rounded-3xl" src={keyboard} alt="keyboard" />
      </div>
      <div>
        <div className="text-6xl p-8 text-darkTone">About Me</div>
        <div className="text-midTone text-2xl px-8">
          I'm a recent Computer Science graduate from Carleton University, based
          in Ottawa, ON. I am keen to transition my academic knowledge into
          practical applications. Actively seeking roles in frontend, backend,
          and full-stack development, I aspire to join a team where innovation,
          collaboration, and making a tangible impact through technology are at
          the forefront. I'm excited about the opportunity to grow as a
          developer and contribute my skills to create meaningful projects.
        </div>
      </div>
    </div>
  );
}

export default AboutMe;
